import { model, Schema } from 'mongoose';

const defaultSettings = {
  text: {
    content: '{customerName} just bought {productName} for {price}!',
    specialColor: '#5746f0',
  },
  display: {
    duration: 7000,
    animationIn: 'animate__fadeInUp',
    animationOut: 'animate__fadeOutUp',
  },
  audio: {
    volume: 80,
    fileName: 'bits.mp3',
    base64:
      'data:audio/mpeg;base64,',
  },
  image: {
    fileName: 'pikachu.png',
    base64:
      'data:image/png;base64,',
  },
  useProductImages: false,
};

interface IUser {
  uuid: string;
  registeredAt: Date;
  shopDomain: string;
  isBlocked: boolean;
  settings: {
    text: {
      content: string;
      specialColor: string;
    };
    display: {
      duration: number;
      animationIn: string;
      animationOut: string;
    };
    audio: {
      fileName: string;
      volume: number;
      base64: string;
    };
    image: {
      fileName: string;
      base64: string;
    };
    useProductImages: boolean;
  };
}

interface CreateUserProps {
  uuid: string;
  shopDomain: string;
}

const userSchema = new Schema<IUser>({
  uuid: String,
  registeredAt: Date,
  shopDomain: String,
  isBlocked: Boolean,
  settings: {
    text: {
      content: String,
      specialColor: String,
    },
    display: {
      duration: Number,
      animationIn: String,
      animationOut: String,
    },
    audio: {
      volume: Number,
      base64: String,
      fileName: String,
    },
    image: {
      base64: String,
      fileName: String,
    },
    useProductImages: Boolean,
  },
});

const UserModel = model<IUser>(
  'User',
  userSchema,
  process.env.MONGODB_USERS_COLLECTION,
);

const createNewUser = ({ uuid, shopDomain }: CreateUserProps) => {
  return new UserModel({
    uuid,
    shopDomain,
    isBlocked: false,
    registeredAt: Date.now(),
    settings: {
      ...defaultSettings,
    },
  });
};

export { UserModel, createNewUser, IUser };
